import { Router } from "react-router-dom";
import Routes from "./routes";
import './tailwind.output.css';

function App() {
  return (
   <Router>
            <Switch>
          <Route path="/about">
            <About />
          </Route>
          <Route path="/topics">
            <Topics />
          </Route>
          <Route path="/">
            <Home />
          </Route>
        </Switch>
            </Router>
  );
}

export default App;
